function ListGroup() {
    const myList = ['New York', 'Paris', 'London', 'Tokyo', 'Jaipur', 'Sydney'];

    return (
        <>
            <p>My List.</p>
            <ul className="list-group">
                {myList.map()};
            </ul>
        </>
    )
}

export default ListGroup;
